  "text" : "万恶的蚂蚁上树RT @danjx: 药监局禁止西药用描述性的文字命名，如感冒通、止疼片等现在都是用西药主要成分命名的，可是中药却一直用描述性的文字命名，如咳特灵、颈复康、护肝片等，光凭名字臆测就培养了无数中医爱好者，应该先禁止中药用描述性文字命名，以免误导消费者",
